 .carousel-wrap {
   width: 100%;
   overflow: hidden;
}

.slide-ul {
  position: relative;
  width: 100%;
  height: 100%;
}

.slide-ul li {
  position: absolute;
  width: 100%;
  height: 100%;
  transition: all 1s ease;
}
.slide-ul .show {
  transition: all 1s ease;
  // transform: translateX(0);
  opacity: 1;
  z-index: 2;
}
.slide-ul .left {
  transition: all 1s ease;
  // transform: translateX(100%);
  opacity: 0;
  z-index: 1
}
.slide-ul .right {
  transition: all 1s ease;
  // transform: translateX(-100%);
  opacity: 0;
  z-index: 1
}
.slide-ul li a {
  display: block;
  width: 100%;
  height: 100%;
  background-repeat: no-repeat;
  background-position: center top;
}

.carousel-items {
  position: absolute;
  z-index: 10;
  top: 558px;
  left: 50%;
  transform: translateX(-50%);
  height: 2px;
  margin: 0 auto;
  text-align: center;
  font-size: 0;
  z-index: 5;
}

.carousel-items span {
  display: inline-block;
  height: 2px;
  cursor: pointer;
}
.carousel-items .active {
  // background-color: orange;
}

.list-enter-to {
  transition: all 1s ease;
  // transform: translateX(0);
  opacity: 1;
  z-index: 9
}

.list-leave-active {
  transition: all 1s ease;
  // transform: translateX(-100%)
  opacity: 0;
  z-index: 1;
}

.list-enter {
  // transform: translateX(100%)
  opacity: 0;
  z-index: 1
}

.list-leave {
  // transform: translateX(0)
  opacity: 1;
  z-index: 9
}
